Международные стажировки AIESEC – это возможность, которая позволит тебе не только побывать за границей, а:
- почувствовать себя частью новой культуры, других традиций;
- узнать о глобальности AIESEC, его проектах и вместе с ним сделать мир лучше;
- получить опыт работы в зарубежных компаниях;
познакомиться со студентами с других стран и континентов;
- привезти домой радугу положительных эмоций, колоссальный опыт работы в международной команде и гигабайты фотографий.

Сделай первый шаг, а дальше мы поможем тебе узнать больше об AIESEC, отправиться на международную стажировку и реализовать свой лидерский потенциал!
